import React, { useState } from "react";
import "./style.css";
const Temp = () => {
  const [state, setstate] = useState("");
  return (
    <>
     <div className="wrap">
        <div className="search">
          <input
            type="search"
            placeholder="search..."
            autoFocus
            id="search"
            className="searchTerm"
          />

          <button
            className="searchButton"
            type="button"
          >
            Search
          </button>
        </div>
      </div>

      <article className="widget">
        <div className="weatherIcon">
          <i className={"wi-day-cloudy"}></i>
        </div>

        
      </article>
    </>
  );
};

export default Temp;
